import React from "react";
import axios from "axios";
import {
  Button,
  Grid,
  Paper,
  Snackbar,
  TextField,
  Typography,
} from "@mui/material";
import { styled } from "@mui/material/styles";
import CheckIcon from "@mui/icons-material/Check";
import MuiAlert from '@mui/material/Alert';

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
  height: 55,
}));

const Profile = () => {
    const [firstName, setFirstName] = React.useState('')
    const [lastName, setLastName] = React.useState('')
    const [birth, setBirth] = React.useState('')
    const [adress, setAdress] = React.useState('')

    const Alert = React.forwardRef(function Alert(props, ref) {
        return <MuiAlert elevation={6} ref={ref} variant="filled" {...props} />;
    });
    const [open, setOpen] = React.useState(false);

    const handleClick = () => {
        setOpen(true);
    };

    const handleClose = (event, reason) => {
        if (reason === 'clickaway') {
            return;
        }

        setOpen(false);
    };

  return (
    <>
      <Grid container spacing={1}>
        <Grid item xs={4}>
          <Item>
            <Typography sx={{ paddingTop: 1 }}>Firstname</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
            <TextField

            />
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ marginTop: 1, marginLeft: 2 }} onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
        <Grid item xs={4}>
          <Item>
            <Typography sx={{ paddingTop: 1 }}>Lastname</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
          <TextField

          />
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ marginTop: 1, marginLeft: 2 }} onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
        <Grid item xs={4}>
          <Item>
            <Typography sx={{ paddingTop: 1 }}>BirthDate</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
          <TextField

          />
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ marginTop: 1, marginLeft: 2 }} onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
        <Grid item xs={4}>
          <Item>
            <Typography>First Address</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
          <TextField

          />
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ marginTop: 1, marginLeft: 2 }} onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
        <Grid item xs={4}>
          <Item>
            <Typography>Second Address</Typography>
          </Item>
        </Grid>
        <Grid item xs={5}>
          <TextField

          />
        </Grid>
        <Grid item xs={3}>
          <Button sx={{ marginTop: 1, marginLeft: 2 }} onClick={handleClick}>
            <CheckIcon />
          </Button>
        </Grid>
      </Grid>
      <Snackbar open={open} autoHideDuration={2000} onClose={handleClose}>
        <Alert onClose={handleClose} severity="success" sx={{ width: '100%' }}>
          The change was succesfully!!
        </Alert>
      </Snackbar>
    </>
  );
};

export default Profile
